SetBitWeight := if String('Demo Current Drilling Mode') = ModeRotary then TagTypVal('Bit Weight')*Rand(1,0.1) else (if String('Demo Current Drilling Mode') = ModeStick then TagTypVal('Bit Weight')*Rand(0.4,0.1) else 0);
SetHookLoad := if String('Well State') = StateDrilling then  (if 'Measured Depth' < 0.8*TagSpan('Measured Depth') then 
 RAND(1,0.05)*TagSpan('Hook Load')*'Measured Depth'/TagSpan('Measured Depth') else 'Hook Load'- Rand()*2) else 0;
