SetMudWt := if String('Well State') = StateDrilling then Rand(1,0.05)* TagTypVal('Mud Weight In') else NoOutput();
SetDiffPressure := if String('Well State') = StateDrilling then Rand(1,0.05)* TagTypVal('Differential Pressure') else 0;

